      SELECT ALL + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + CAST ( + col2 AS INTEGER ) + ( + col1 ) + + col2 NOT BETWEEN + 24 AND NULL;
  - name: tab0

outputs:
  - name: q3336.out
    data: |
